		//בודק את הגרירה על האובייקט
		function dragFunc(e) {
		
			console.log("dragFunc(e)");
		
			drag = true; //משתנה הבודק האם המכתב אכן נגרר או לא
		
		
			if (questions[rndQ][3] == "picture") { //במידה והמסיח תמונה
		
				picOriginalSize(); //החזרת המכתב לגודל המקורי
		
				stage.getChildByName("picplus").visible = false; //הסתרת זכוכית מגדלת
			}
		
		
			var p = stage.globalToLocal(stage.mouseX, stage.mouseY); //משתנה השומר את ערכי הx וy של העכבר
			e.currentTarget.x = p.x; //עידכון הx וy של המכתב בהתאם לעכבר
			e.currentTarget.y = p.y;
		
		
			for (i = 0; i < categoryNum; i++) {
		
				console.log("interrrrrrrr " + categoriesTxt[i][1])
		
				if (intersect(e.currentTarget, stage.getChildByName("myMailbox" + categoriesTxt[i][1]))) { //בדיקה פגיעה בין המכתב לתיבות הדואר
		
					stage.getChildByName("myMailbox" + categoriesTxt[i][1]).gotoAndStop(1); //העברת התיבה לפריים 1 - מודגש
		
				} else {
					stage.getChildByName("myMailbox" + categoriesTxt[i][1]).gotoAndStop(0); //החזרת התיבה לפריים 0 - לא מודגש
				}
		
			}
		}
		// בודק את השחרור- אם תשובה נכונה או לא
		function release(e) {
		
			console.log("release(e)");
			console.log("drag: " + drag);
		
			if (mysecCounter > 0) { //בתנאי שהשחרור הוא במהלך המשחק
		
				var currentMailboxi; //שמיאת הi של התיבת דואר ששם יש חפיפה
				var hit; //משתנה הבודק האם יש חפיפה
		
				//החזרת התיבות דואר לפריים הראשון ללא הדגשה
				for (i = 0; i < categoryNum; i++) {
					stage.getChildByName("myMailbox" + categoriesTxt[i][1]).gotoAndStop(0);
		
					//במידה ויש חפיפה בין אובייקט המכתב לאחד מתיבות הדואר
					if (intersect(e.currentTarget, stage.getChildByName("myMailbox" + categoriesTxt[i][1]))) {
						var hit = true;
						var currentMailboxi = categoriesTxt[i][1];
					}
				}
		
		
				if (hit == true) { //במידה והיה פגיעה
		
					totalTimesAnswered++; //משנה הסופר כמה נסיונות מענה היו
		
					freezeObjects(); //העלמת אובייקטים שלא הכרחיים
		
					//משתנה לתיבת הדואר שחופף עם המכתב
					var currentmailbox = stage.getChildByName("myMailbox" + currentMailboxi);
		
					//במידה ובמכתב היה תמונה
					if (questions[rndQ][3] == "picture") {
						console.log("removed m glass in realease");
						var myl = stage.getChildByName("myLetter");
						myl.removeChild(myl.getChildByName("letterpic")); //מחיקת תמונה מהמסך
					}
		
					//תשובה נכונה
					if (currentMailboxi == questions[rndQ][1]) {
						if (questions[rndQ][2] == "incorrect") { //במידה וענו כבר על השאלה בצורה לא נכונה
							questions[rndQ].splice(2, 1, "correct2ndplus"); //הוספת סימן למערך
						}
						//במידה ועוד לא ענו על השאלה
						else {
							questions[rndQ].splice(2, 1, "correct"); //הוספת סימן למערך
						}
		
						correctItems++;
		
						//משוב להצלחה
						var vi = new lib.vi(); //הוספת וי מעל התיבה הנכונה
						vi.name = "vi";
						vi.x = currentmailbox.x + 7;
						vi.y = currentmailbox.y - 60;
						stage.addChild(vi);
		
						stage.getChildByName("myMailman").gotoAndPlay(185); //ניגון האנימציה
						//הפניה לסאונד בזמן הצלחה
						createjs.Sound.play("Win");
		
		
						var envelope = new lib.envelope(); //ניגון אנימציה של מעטפה נכנסת לתיבה
						envelope.name = "envelope";
						envelope.x = currentmailbox.x;
						envelope.y = currentmailbox.y - 60;
						stage.addChild(envelope);
						envelope.gotoAndPlay(0);
		
						setTimeout(function () { //המשך לשאלה הבאה
							nextquestion();
						}, 1900);
		
					}
		
					//תשובה לא נכונה
					else {
		
						console.log("wrong hit");
		
						//משוב לאי הצלחה
						var eex = new lib.eex(); //הוספת איקס מעל התיבה
						eex.name = "eex";
						eex.x = currentmailbox.x;
						eex.y = currentmailbox.y - 60;
						stage.addChild(eex);
		
						questions[rndQ].splice(2, 1, "incorrect"); //הוספה למערך סימן שתשובה לא נכונה
		
		
						stage.getChildByName("myMailman").gotoAndPlay(57); //ניגון אנימציה של משוב שלילי
		
		
						createjs.Sound.play("wrong");
		
		
						setTimeout(function () { //המשך לשאלה הבאה
							nextquestion();
						}, 3250);
		
					}
		
					clearInterval(myInterval);
		
		
				} else { //במידה ולא היה פגיעה
		
					if (drag == true) { //החזרת הזכוכית מגדלת במידה והמסיח היה תמונה והמכתב נגרר קודם
		
						stage.getChildByName("myLetter").x = 687;
						stage.getChildByName("myLetter").y = 340;
		
						if (questions[rndQ][3] == "picture") {
							stage.getChildByName("picplus").visible = true;
						}
					}
				}
		
				drag = false;
			}
		}
