		//החץ למעלה של המשוב
		function upArrowFunc(e) {
		
			var currenti = e.currentTarget.name.slice(2); //שומר את ערך הi של הכפתור שנלחץ
			var curWhite = stage.getChildByName("white" + currenti); //משתנה הקורא לפס הלבן ששייך לכפתור
			curWhite.y += 50; //הזזת התשובות למעלה
			if (curWhite.y < 230) { //אם עדיין יש לאן לגלול למעלה
				e.currentTarget.visible = true; //הצגת החץ למעלה
			} else { //אם אין לאן לגלול למעלה
				e.currentTarget.visible = false; //העלמת החץ למעלה
			}
			stage.getChildByName("down" + currenti).visible = true; //הצגת כפתור לחיצה למטה
		}
		// החץ למטה של המשוב
		function downArrowFunc(e) {
			var currenti = e.currentTarget.name.slice(4); //שומר את ערך הi של הכפתור שנלחץ
			var curWhite = stage.getChildByName("white" + currenti); //משתנה הקורא לפב הלבן ששייך לכפתור
		
			curWhite.y -= 50; //הזזת התשובות למטה
		
			var remainAnswers = parseInt(5) - 2; //מספר הפריטים שנמצא מחוץ לגבולות התצוגה
			var remainHeight = remainAnswers * 132; //זיהוי הגובה שצריך להזיז את הקטגוריה
			if (curWhite.y > 230 - remainHeight) { //אם עדיין יש לאן לגלול למטה
				e.currentTarget.visible = true; //הצגת החץ למטה
			} else { //אם אין לאן לגלול למטה
				e.currentTarget.visible = false; //העלמת החץ למטה
		
			}
			stage.getChildByName("up" + currenti).visible = true; //הצגת החץ למעלה
		}
